
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='600' height='300'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #rect1
	ctx.beginPath();
	ctx.globalAlpha = 0.7;
	ctx.fillStyle = 'rgb(255, 255, 255)';
	ctx.lineWidth = 0.000000;
	ctx.moveTo(64.238853, 83.874667);
	ctx.lineTo(64.238853, 153.904965);
	ctx.quadraticCurveTo(64.238853, 155.323791, 79.238853, 155.323791);
	ctx.lineTo(138.406219, 155.323791);
	ctx.quadraticCurveTo(153.406219, 155.323791, 153.406219, 153.904965);
	ctx.lineTo(153.406219, 83.874667);
	ctx.quadraticCurveTo(153.406219, 82.455841, 138.406219, 82.455841);
	ctx.lineTo(79.238853, 82.455841);
	ctx.quadraticCurveTo(64.238853, 82.455841, 64.238853, 83.874667);
	ctx.fill();

    </script>
</body>
</html>
